int cntr = 0;
std::pair<double, double> get_M_D(const std::vector<double> &v) {
    double s1 = 0;
    double s2 = 0;

    for (int i = 0; i < v.size(); ++i) {
        s1 += v[i];
        s2 += v[i] * v[i];
    }
    s1 /= v.size();
    s2 = s2 / v.size() - s1 * s1;
    return {s1, sqrt(s2)};
}
